class Solution {
  int minimumCost(List<int> nums, int k, int dist) {
    int n = nums.length;
    List<int> prefixSum = List.filled(n + 1, 0);
    for (int i = 1; i <= n; ++i) {
      prefixSum[i] = prefixSum[i - 1] + nums[i - 1];
    }

    List<List<int>> dp = List.generate(k + 1, (_) => List.filled(n + 1, 1 << 30));
    dp[0][0] = 0;
    for (int i = 1; i <= k; ++i) {
      for (int j = i; j <= n; ++j) {
        for (int l = i - 1; l <= j - 1 && j - l <= dist + 1; ++l) {
          dp[i][j] = dp[i][j] < dp[i - 1][l] + nums[l] ? dp[i][j] : dp[i - 1][l] + nums[l];
        }
      }
    }

    int result = 1 << 30;
    for (int i = k - 1; i < n; ++i) {
      if (n - i - 1 <= dist) {
        result = result < dp[k][i + 1] ? result : dp[k][i + 1];
      }
    }
    return result;
  }
}
